catagorys = Catagory.all
statuses = ['submitted', 'reviewed', 'rejected']
users = User.all

promotions.each do |p|
	user = users[rand(0..users.count - 1)]
	promotion = user.promotions.build(p)
	promotion.expire_at = promotion.start_at + 2.weeks
	promotion.catagory = catagorys[rand(0..catagorys.count - 1)]
	promotion.status = statuses[rand(0..2)]

	promotion.save

	puts promotion.status
end


